(4, 'Privacy Policy', 'privacy-policy', '<p style=\"text-align: justify;\"><span style=\"font-size: 14px;\">﻿</span><span style=\"font-size: 14px;\">﻿</span><span style=\"font-size: 14px;\">﻿</span>﻿﻿﻿<span style=\"font-size: 0.875rem; letter-spacing: 0px;\">﻿</span><span style=\"font-size: 0.875rem; letter-spacing: 0px;\">﻿﻿Protecting your private information is our priority. This Statement of Privacy applies to MTGPro.me, and Non-QM Doc LLC and governs data collection and usage. For the purposes of this Privacy Policy, unless otherwise noted, all references to Non-QM Doc LLC include www.MTGPro.me and&nbsp;<span style=\"font-weight: 600;\">MTGPro.me.</span>&nbsp;The MTGPro.me application is a Digital Marketing and Ecommerce application. By using the&nbsp;<span style=\"font-weight: 600;\">MTGPro.me</span>&nbsp;application, you consent to the data practices described in this statement.</span><br></p><div><span style=\"font-size: 0.875rem; letter-spacing: 0px;\"><span style=\"font-weight: 600;\">Collection of your Personal Information</span></span><br></div><div style=\"text-align: justify;\">In order to better provide you with products and services offered, MTGPro.me may collect personally identifiable information, such as your:&nbsp;&nbsp;</div><div style=\"text-align: justify;\"><br></div><ul><li>First and Last Name</li><li>Mailing Address</li><li>E-mail Address</li><li>Phone Number</li><li>Employer</li><li>Job Title</li><li>Social Media Profiles, Websites, Etc.&nbsp;</li></ul><div style=\"text-align: justify;\">If you purchase&nbsp;<span style=\"font-weight: 600;\">MTGPro.me\'s</span>&nbsp;products and services, we collect billing and credit card information. This information is used to complete the purchase transaction.</div><div><br></div><div style=\"text-align: justify;\">We do not collect any personal information about you unless you voluntarily provide it to us. However, you may be required to provide certain personal information to us when you elect to use certain products or services. These may include: (a) registering for an account; (b) entering a sweepstakes or contest sponsored by us or one of our partners; (c) signing up for special offers from selected third parties; (d) sending us an email message; (e) submitting your credit card or other payment information when ordering and purchasing products and services. To wit, we will use your information for, but not limited to, communicating with you in relation to services and/or products you have requested from us. We also may gather additional personal or non-personal information in the future</div><div><br></div><div><div><span style=\"font-weight: 600;\">Use of your Personal Information</span></div><div><br></div><div><span style=\"font-weight: 600;\">MTGPro.me</span>&nbsp;collects and uses your personal information to operate and deliver the services you have requested.</div><div><br></div><div style=\"text-align: justify;\"><span style=\"font-weight: 600;\">MTGPro.me</span>&nbsp;may also use your personally identifiable information to inform you of other products or services available from&nbsp;<span style=\"font-weight: 600;\">MTGPro.me</span>&nbsp;and its affiliates.</div><div><br></div><div><span style=\"font-weight: 600;\">Sharing Information with Third Parties</span></div><div><br></div><div><span style=\"font-weight: 600;\">MTGPro.me</span>&nbsp;does not sell, rent or lease its customer lists to third parties.</div><div><br></div><div style=\"text-align: justify;\"><span style=\"font-weight: 600;\">MTGPro.me&nbsp;</span>may, from time to time, contact you on behalf of external business partners about a particular offering that may be of interest to you. In those cases, your unique personally identifiable information&nbsp;<span style=\"font-weight: 600;\">(e-mail, name, address, telephone number)</span>&nbsp;is transferred to the third party.&nbsp;<span style=\"font-weight: 600;\">MTGPro.me</span>&nbsp;may share data with trusted partners to help perform statistical analysis, send you email or postal mail, provide customer support, or arrange for deliveries. All such third parties are prohibited from using your personal information except to provide these services to&nbsp;<span style=\"font-weight: 600;\">MTGPro.me</span>, and they are required to maintain the confidentiality of your information.&nbsp;</div><div style=\"text-align: justify;\"><br></div><div style=\"text-align: justify;\"><span style=\"font-weight: 600;\">MTGPro.me</span>&nbsp;may disclose your personal information, without notice, if required to do so by law or in the good faith belief that such action is necessary to: (a) conform to the edicts of the law or comply with legal process served on&nbsp;<span style=\"font-weight: 600;\">MTGPro.me</span>&nbsp;or the site; (b) protect and defend the rights or property of&nbsp;<span style=\"font-weight: 600;\">MTGPro.me</span>; and/or (c) act under exigent circumstances to protect the personal safety of users of&nbsp;<span style=\"font-weight: 600;\">MTGPro.me,</span>&nbsp;or the public.</div><div style=\"text-align: justify;\"><br></div><div style=\"text-align: justify;\"><span style=\"font-weight: 600;\">Opt-Out of Disclosure of Personal Information to Third Parties</span></div><div style=\"text-align: justify;\"><br></div><div style=\"text-align: justify;\">In connection with any personal information we may disclose to a third party for a business purpose, you have the right to know:&nbsp;</div><ul><li style=\"text-align: justify;\"><span style=\"font-size: 0.875rem; letter-spacing: 0px;\">The categories of personal information that we disclosed about you for a business purpose.&nbsp;</span><br></li></ul><div style=\"text-align: justify;\">You have the right under the California Consumer Privacy Act of 2018&nbsp;<span style=\"font-weight: 600;\">(CCPA)</span>&nbsp;and certain other privacy and data protection laws, as applicable, to opt-out of the disclosure of your personal information. If you exercise your right to opt-out of the disclosure of your personal information, we will refrain from disclosing your personal information, unless you subsequently provide express authorization for the disclosure of your personal information. To opt-out of the disclosure of your personal information, Email us at info@mtgpro.me.&nbsp;</div><div><br></div><div><div><span style=\"font-weight: 600;\">Right to Deletion</span></div><div><span style=\"font-size: 0.875rem; letter-spacing: 0px;\">Subject to certain exceptions set out below, on receipt of a verifiable request from you, we will:</span></div><ul><li><span style=\"font-size: 0.875rem; letter-spacing: 0px;\">Delete your personal information from our records; and</span></li><li>Direct any service providers to delete your personal information from their records.&nbsp;</li></ul><div>Please note that we may not be able to comply with requests to delete your personal information if it is necessary to:</div><div><br></div><ul><li style=\"text-align: justify;\">Complete the transaction for which the personal information was collected, fulfill the terms of a written warranty or product recall conducted in accordance with federal law, provide a good or service requested by you, or reasonably anticipated within the context of our ongoing business relationship with you, or otherwise perform a contract between you and us;</li><li style=\"text-align: justify;\">Detect security incidents, protect against malicious, deceptive, fraudulent, or illegal activity; or prosecute those responsible for that activity;</li><li style=\"text-align: justify;\">Debug to identify and repair errors that impair existing intended functionality;</li><li style=\"text-align: justify;\">Exercise free speech, ensure the right of another consumer to exercise his or her right of free speech, or exercise another right provided for by law;</li><li style=\"text-align: justify;\">Comply with the California Electronic Communications Privacy Act;</li><li style=\"text-align: justify;\">Engage in public or peer-reviewed scientific, historical, or statistical research in the public interest that adheres to all other applicable ethics and privacy laws, when our deletion of the information is likely to render impossible or seriously impair the achievement of such research, provided we have obtained your informed consent; • Enable solely internal uses that are reasonably aligned with your expectations based on your relationship with us;</li><li style=\"text-align: justify;\">Comply with an existing legal obligation; or</li><li style=\"text-align: justify;\">Otherwise use your personal information, internally, in a lawful manner that is compatible with the context in which you provided the information.</li></ul><div><span style=\"font-weight: 600;\">Children Under</span></div><div><br></div><div style=\"text-align: justify;\">Thirteen&nbsp;<span style=\"font-weight: 600;\">MTGPro.me</span>&nbsp;does not knowingly collect personally identifiable information from children under the age of thirteen. If you are under the age of thirteen, you must ask your parent or guardian for permission to use this application.</div><div><br></div><div><div><span style=\"font-weight: 600;\">Disconnecting your MTGPro.me Account from Third Party Websites</span></div><div><br></div><div style=\"text-align: justify;\">You will be able to connect your&nbsp;<span style=\"font-weight: 600;\">MTGPro.me</span>&nbsp;account to third-party accounts. BY CONNECTING YOUR&nbsp;<span style=\"font-weight: 600;\">MTGPRO.ME</span>&nbsp;ACCOUNT TO YOUR THIRD PARTY ACCOUNT, YOU ACKNOWLEDGE AND AGREE THAT YOU ARE CONSENTING TO THE CONTINUOUS RELEASE OF INFORMATION ABOUT YOU TO OTHERS (IN ACCORDANCE WITH YOUR PRIVACY SETTINGS ON THOSE THIRD PARTY SITES). IF YOU DO NOT WANT INFORMATION ABOUT YOU, INCLUDING PERSONALLY IDENTIFYING INFORMATION, TO BE SHARED IN THIS MANNER, DO NOT USE THIS FEATURE. You may disconnect your account from a third party account at any time. by removing the link to the third party site from their account&nbsp;&nbsp;</div><div><br></div><div><span style=\"font-weight: 600;\">Opt-Out &amp; Unsubscribe from Third Party Communications</span></div><div><br></div><div style=\"text-align: justify;\">We respect your privacy and give you an opportunity to opt-out of receiving announcements of certain information. Users may opt-out of receiving any or all communications from third-party partners of&nbsp;<span style=\"font-weight: 600;\">MTGPro.me</span>&nbsp;by contacting us here:</div><div><br></div><div><br></div><div>Email:&nbsp;<span style=\"font-weight: 600;\">info@mtgpro.me</span></div><div><br></div><div><br></div><div><span style=\"font-weight: 600;\">E-mail Communications</span></div><div><span style=\"text-align: justify; font-size: 0.875rem; letter-spacing: 0px;\">From time to time,</span><span style=\"font-weight: 600; text-align: justify; font-size: 0.875rem; letter-spacing: 0px;\">&nbsp;MTGPro.me</span><span style=\"text-align: justify; font-size: 0.875rem; letter-spacing: 0px;\">&nbsp;may contact you via email for the purpose of providing announcements, promotional offers, alerts, confirmations, surveys, and/or other general communication. In order to improve our Services, we may receive a notification when you open an email from MTGPro.me or click on a link therein.&nbsp;</span><br></div><div><br></div><div><span style=\"font-weight: 600;\">External Data Storage Sites</span></div><div><span style=\"font-size: 0.875rem; letter-spacing: 0px;\">We may store your data on servers provided by third party hosting vendors with whom we have contracted.&nbsp;</span><br></div><div><br></div><div><span style=\"font-weight: 600;\">Changes to this Statement</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 0.875rem; letter-spacing: 0px;\"><span style=\"font-weight: 600;\">MTGPro.me</span>&nbsp;reserves the right to change this Privacy Policy from time to time. We will notify you about significant changes in the way we treat personal information by sending a notice to the primary email address specified in your account, by placing a prominent notice on our application, and/or by updating any privacy information. Your continued use of the application and/or Services available after such modifications will constitute your: (a) acknowledgment of the modified Privacy Policy; and (b) agreement to abide and be bound by that Policy.</span><br></div><div><br></div><div><span style=\"font-weight: 600;\">Contact Information</span></div><div><br></div><div><span style=\"font-weight: 600;\">MTGPro.me</span>&nbsp;welcomes your questions or comments regarding this Statement of Privacy. If you believe that&nbsp;<span style=\"font-weight: 600;\">MTGPro.me</span>&nbsp;has not adhered to this Statement, please contact&nbsp;<span style=\"font-weight: 600;\">MTGPro.me</span>&nbsp;at:</div><div><br></div><div><div><span style=\"font-weight: 600;\">Mtgo Pro</span></div><div>Non-QM Doc LLC</div><div>1603 Capitol Ave Suite 310</div><div>Cheyenne, Wyoming 82001</div><div><br></div><div>Email Address:</div><div><span style=\"font-weight: 600;\">info@MTGPro.me</span></div><div><br></div><div><br></div><div>Effective as of January 10, 2023</div></div></div></div></div>', 1, 1, NULL, NULL, NULL, 1, '2022-11-26 10:03:52', '2023-02-07 08:46:07', NULL, 91, NULL),
