(11, 'Brandable Mortgage Guide Booklet', 1, 'https://www.mtgpro.me/assets/uploads/marketing-materials/1675347490.png', '<p>This 15 page brandable mortgage guide is packed with information on the mortgage process and different loan types including USDA &amp; Non-QM!&nbsp;</p>', 1, '2023-02-02 20:18:10', NULL, '2023-02-02 20:18:10', NULL, 'MTGPRO.ME', 'https://www.mtgpro.me/assets/uploads/marketing-materials/1675347490.pdf'),
