(13, 'MTGPRO - PROpad', 'mtgpro-propad', '/productThumb/propad_sample_for_bg-removebg-preview-63d714d816b1f.png', '<p><span style=\"font-size: 14px;\">﻿</span><span style=\"font-size: 14px;\">﻿</span>The PROpad - a sleek epoxy sticker embedded with the link to your PROfile. Measuring slightly over a square inch, the PROpad has a backing that when peeled off can be attached to virtually anything (except metal)</p>', 3500, 4000, 2, 0, 1, '2023-01-29 20:04:48', '2023-01-30 06:52:40', 0.00, 91, 91),
(14, 'MTG PRO - PROfob', 'mtg-pro-profob14', '/productThumb/profob_front-removebg-preview-63d6d9f73a245.png', '<p><span style=\"font-size: 14px;\">﻿</span>A sleek &amp; durable fob that you can&nbsp; loop onto virtually anything! Many of our PROs secure their PROfob to their keys but some have also secured it to different zippers, wallets and gym bags!</p>', 20900, 21900, 2, 0, 1, '2023-01-29 20:08:58', '2023-01-30 02:41:27', 0.00, 91, 91),
(15, 'PROchain - White', 'prochain-white15', '/productThumb/prochain_white-removebg-preview-63e1bd95374f9.png', '<p><span style=\"font-size: 14px;\">﻿</span><span style=\"font-size: 14px;\">﻿</span>The PROchain -&nbsp; White. A simple, lightweight keychain with your PROfile embedded inside to quickly tap against anyone\'s phone and let them see realize you are the MTGPRO they need to work with.</p>', 34800, 35800, 1, 0, 1, '2023-01-29 20:20:52', '2023-02-07 08:55:17', 0.00, 91, 91),
(16, 'MTGPRO - PROcard', 'mtgpro-procard16', '/productThumb/procard--63d6e4e9a363e.png', '<p><span style=\"font-size: 14px;\">﻿</span><span style=\"font-size: 14px;\">﻿</span>An engraved metal card with a luxurious and executive feel. With a quick tap of your PROcard on anyone\'s phone, they\'ll get a notification on their phone to open their browser and be taken right to your PROfessional profile with your contact info, MTG Calculator, social media links and more!</p>', 34800, 35800, 1, 0, 1, '2023-01-29 20:21:24', '2023-01-30 03:28:09', 0.00, 91, 91),
(17, 'PROChain - Black', 'prochain-black17', '/productThumb/prochain_black-removebg-preview-63d7138fb161c.png', '<p><span style=\"font-size: 14px;\">﻿</span><span style=\"font-size: 14px;\">﻿</span><span style=\"font-size: 0.875rem; letter-spacing: 0px; text-align: var(--bs-body-text-align);\">﻿</span><span style=\"font-size: 0.875rem; letter-spacing: 0px; text-align: var(--bs-body-text-align);\">The PROchain - Black. A simple, lightweight keychain with your PROfile embedded inside to quickly tap against anyone\'s phone and let them see realize you are the MTGPRO they need to work with.</span><br></p>', 5000, 5500, 2, 0, 1, '2023-01-30 02:59:53', '2023-01-30 06:47:11', 0.00, 91, 91);
